import styled from "styled-components";

export const StyledDiv = styled.div`
   text-align: center;
  padding-top: 10px;
  background-color: rgb(201, 17, 17);
  width:100%;
  height: 51px;
  display: flex;
  justify-content: center;
  align-items: center;
  position: sticky;
  top: 0;
  z-index:1;
`;
